import React from "react";
import styles from "./Job.module.css";

interface JobProps {
  img: string;
  header: string;
}

const Job: React.FC<JobProps> = ({ img, header }) => {
  return (
    <div className="styles.container">
      <img src={img} alt="" />
      <div className="main">
        <h1>{header}</h1>
        <p>Sub info</p>
        <p>Location</p>
      </div>
    </div>
  );
};

export default Job;
